import AppC from "./App.module.css"
import UserProfile from "./components/UserProfile/UserProfile"
import Button from "./components/Button/Button"

function App() {

    const a = () =>{
        prompt('asdasdasdasd')
    }
    

    const b = () => {
        alert('asdasd')
    }
    return (
        <>
        <UserProfile name="Name" age="Age" URL="https://avatars.mds.yandex.net/i?id=84987cede98c0787967f9e26400efc4363b2b199-10604114-images-thumbs&n=13"/>
        <Button text="ButtonText" fun="" click={a}/>
        <Button text="ButtonText" fun="" click={b}/>
        </>
    )
}
export default App
